import React, { useContext, useRef, useState } from "react";
import { AuthContext} from "../../context/AuthContext";
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import EditIcon from '@mui/icons-material/Edit';
import "./profileEditDialog.css";


const {user} = useContext(AuthContext);

const ProfileEditDialog = () => {
  const [open, setOpen] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleSaveChanges = () => {
    // Implement your logic to save changes here
    // This function will be called when the "Save Changes" button is clicked
    setOpen(false);
  };

  return (
    <div>
      <button className="editButton" onClick={handleOpen}>
        Edit Profile&nbsp;<EditIcon />
      </button>
      <Dialog open={open} onClose={handleClose}>
        <div className="dialogTitle">Edit Profile</div>
        <hr className="dialogHr" />
        <DialogContent>
          <form className='editProfileForm'>
            <div className="editProfileInputItem">
              <label 
                className="editProfileLabel"
              >
                Username:
              </label>
              <input 
                className="editProfileInput" 
                type="text" 
                placeholder= {user.username}
              />
            </div>
            <div className="editProfileInputItem">
              <label className="editProfileLabel" >Username</label>
              <input className="editProfileInput" type="text" placeholder="Enter new username" />
            </div>
            <div className="editProfileInputItem">
              <label className="editProfileLabel">Username</label>
              <input className="editProfileInput" type="text" placeholder="Enter new username" />
            </div>
          </form>
        </DialogContent>
        <DialogActions className='editProfileActions'>
          <button onClick={handleClose}>Cancel</button>
          <button onClick={handleSaveChanges}>
            Save Changes
          </button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default ProfileEditDialog;
